import React from 'react';
import Card from "react-bootstrap/Card";
import Button from 'react-bootstrap/Button';
import carImage from '../img/toyota_aygoxxlimitedsu1b_angularfront.jpg'; // Ajustez le chemin si nécessaire
import { Container } from 'react-bootstrap';


export const VehiclesCardrousel = () => {
    return (
        <div>
            <Card style={{ width: '18rem' }}>
                <Card.Img className="mt-5" variant="top" src={carImage} />
                <Card.Body>
                    <Card.Title className='text-primary vehicle-card-title'>Toyota - Aygox</Card.Title>
                    <Card.Text className='text-dark mb-0'>
                        2007 - 100 000 km 
                    </Card.Text> 
                    <Card.Text className='text-dark'>
                        Diesel - Manuelle 6
                    </Card.Text> 
                    <Container className= 'text-center'>
                        28000€
                    </Container>
                    <Button variant="primary">Go somewhere</Button>
                </Card.Body>
            </Card>
        </div>
    );
};

export default VehiclesCardrousel;
